import React from "react";

const SocialLinks = (props) => {
  const abir = props.social.map((soc, index) => (
    <li>
      <a href={soc.link}>{soc.mediaName}</a>
    </li>
  ));
  return (
    <div>
      <h3>Contact With Me</h3>
      <ul>{abir}</ul>
    </div>
  );
};

export default SocialLinks;
